import './App.css';
import Header from './components/Header';
import Cards from './components/Cards';
import { Routes,Route,BrowserRouter as Router} from 'react-router-dom';
function App() {
  return (
    <Router>
    <div className="App">
      < Header/>
      <Routes>
        <Route path="/" element={<Cards/>} />
      </Routes>
    </div>
    </Router>
  );
}

export default App;
